import { createSlice } from '@reduxjs/toolkit';

const userSlice = createSlice({
    name: 'user',
    initialState:{
        id: 1,
        email: "gabriel",
        questionsId: [14, 77]
    },
    reducers:
    {
        changeUser(state, action)
        {
            state = action.payload;
        }
    }
});

export const { changeUser } = userSlice.actions;
export const userReducer = userSlice.reducer;
